import React from 'react'


const Input = (props) => {

    const inputType = props.type || 'text';
    const htmlFor = `${inputType}-${Math.random()}`

   return (<div>
    <input
            value={props.value}
            id={htmlFor}
        name={props.name}
        type={props.type}
        onChange={props.onChange}
        placeholder={props.placeholder}
        />
    </div>)
}

export default Input;
